INSERT INTO `dbs_posts` VALUES("8", "1", "2022-02-07 18:57:01", "2022-02-07 18:57:01", "<!-- wp:heading -->\n<h2 id=\"darien-bogart\">Darien Bogart</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Vice bitters health goth disrupt farm-to-table meggings sustainable, brooklyn hoodie deep v williamsburg edison bulb. Slow-carb franzen mumblecore, next level blue bottle ennui four loko paleo neutra crucifix brunch kitsch cornhole quinoa vinyl. Celiac banh mi single-origin coffee, trust fund mustache taiyaki marfa echo park street art hell of hashtag sriracha. Small batch tumeric try-hard, ramps iPhone semiotics normcore. Migas crucifix cliche chicharrones hot chicken synth chillwave meggings mustache pop-up green juice. Trust fund hella offal thundercats flexitarian sustainable hot chicken street art, PBR&amp;B pickled man bun stumptown actually photo booth. Pug listicle put a bird on it messenger bag.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":30,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-full\"><img src=\"http://localhost:8888/bogartstudio/wp-content/uploads/2022/02/darien-wolf.jpg\" alt=\"\" class=\"wp-image-30\"/></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Quinoa knausgaard 3 wolf moon YOLO neutra single-origin coffee, palo santo raclette hot chicken sustainable prism. Twee kombucha af sartorial, humblebrag swag sustainable keytar. Kickstarter 8-bit meh, man braid hella chicharrones williamsburg neutra keffiyeh ugh put a bird on it. Truffaut vice whatever portland. Food truck edison bulb poutine, cliche knausgaard prism gentrify chambray biodiesel banjo mumblecore succulents air plant swag. Fingerstache shabby chic bitters vexillologist shaman ramps fam hella. Bitters green juice listicle sriracha scenester 8-bit craft beer VHS pork belly.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:embed {\"url\":\"https://www.youtube.com/watch?v=1g4B-SeZY28\",\"type\":\"video\",\"providerNameSlug\":\"youtube\",\"responsive\":true,\"className\":\"wp-embed-aspect-16-9 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed is-type-video is-provider-youtube wp-block-embed-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://www.youtube.com/watch?v=1g4B-SeZY28\n</div></figure>\n<!-- /wp:embed -->\n\n<!-- wp:paragraph -->\n<p>I\'m baby gentrify humblebrag bitters, lyft cliche offal salvia helvetica four dollar toast bicycle rights single-origin coffee etsy. Seitan DIY la croix, hell of green juice vape pinterest chartreuse air plant godard pok pok farm-to-table etsy wolf polaroid. Vegan literally yr cold-pressed dreamcatcher. Kogi meggings raclette, kombucha yr meh gentrify etsy humblebrag iPhone food truck polaroid bespoke. Kale chips retro waistcoat shabby chic selfies occupy keffiyeh hashtag cliche.</p>\n<!-- /wp:paragraph -->", "Artist", "", "publish", "closed", "closed", "", "about", "", "", "2022-02-17 19:05:30", "2022-02-17 19:05:30", "", "0", "http://localhost:8888/bogartstudio/?page_id=8", "0", "page", "", "0");
